// Function to search for an img with the specified class and src attribute
function searchForImg(node) {
    if (!node || !node.querySelectorAll) return null;
    const imgsWithClassAndSrc = node.querySelectorAll('img.K1vBa._1aShU.ZRhsD');
    return imgsWithClassAndSrc.length > 0 ? imgsWithClassAndSrc[0] : null;
}
function imageToBase64(imageUrl) {
    return new Promise((resolve, reject) => {
        const xhr = new XMLHttpRequest();
        xhr.onload = function() {
            const reader = new FileReader();
            reader.onloadend = function() {
                resolve(reader.result);
            };
            reader.onerror = reject;
            reader.readAsDataURL(xhr.response);
        };
        xhr.onerror = reject;
        xhr.open('GET', imageUrl);
        xhr.responseType = 'blob';
        xhr.send();
    });
}
