function logChanges(mutationsList, observer) {
    mutationsList.forEach(mutation => {
        if (mutation.type === 'childList') {
            mutation.addedNodes.forEach(node => {
                if (node.nodeType === Node.ELEMENT_NODE && node.nodeName === 'DIV') {
                    const targetImg = searchForImg(node);
                    if (targetImg) {
                        Promise.all([imageToBase64(targetImg.src), "data:image/webp;base64,"])
                            .then(([localImageBase64, targetImageBase64]) => {
                                compareImages(localImageBase64, targetImageBase64);
                            })
                            .catch(error => {
                                console.error('Error:', error);
                            });
                    }
                }
            });
        }
    });
}

const observer = new MutationObserver(logChanges);
observer.observe(document, { attributes: true, childList: true, subtree: true });
